import React, { useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import './HomePage.css';


function HomePage({ onLogout }) {
  const imagesRef = useRef(null);
  const navigate = useNavigate();

  const handleGetStarted = () => {
    imagesRef.current.scrollIntoView({ behavior: 'smooth' });
  };

  const handleLogout = () => {
    onLogout();
    navigate('/login');
  };

  const handleLaunch = () => {
    navigate('/launch');
  };

  const handleAboutUs = () => {
    console.log('About Us clicked');
    // Add navigation or modal opening logic here
  };

  const handleContact = () => {
    console.log('Contact clicked');
    // Add navigation or modal opening logic here
  };

  return (
    <div className="home-page">
      <div className="top-right">
        <button className="logout-btn" onClick={handleLogout}>Logout</button>
      </div>
      <div className="center">
        <div className="button-group">
          <button className="get-started-btn" onClick={handleGetStarted}>Get Started</button>
          <button className="about-us-btn" onClick={handleAboutUs}>About Us</button>
          <button className="contact-btn" onClick={handleContact}>Contact</button>
        </div>
      </div>
      <div className="images-section" ref={imagesRef}>
        <div className="image-container">
        <div className="image-placeholder">Image 1</div>
        </div>
        <div className="image-container">
          <div className="image-placeholder">Image 2</div>
        </div>
        <div className="image-container">
          <div className="image-placeholder">Image 3</div>
        </div>
      </div>
      <div className="launch-container">
        <button className="launch-btn" onClick={handleLaunch}>Launch</button>
      </div>
    </div>
  );
}

export default HomePage;
